
    DROP DATABASE IF EXISTS nintento_games;
    CREATE DATABASE nintendo_games;

    USE nintendo_games;

    CREATE TABLE game(
        id INT NOT NULL AUTO_INCREMENT,
        series VARCHAR(100),
        character CHAR(50),
        image VARCHAR(250),
        name VARCHAR(100),
        type CHAR(30),
        price DOUBLE (5,2),
        PRIMARY KEY (id)
    );

